import React from "react";
import Comment from "../Comment/index";

const CommentList = ({ comments, onDelete, onEdit }) => {
  return (
    <div>
      {comments.map((comment) => (
        <Comment
          key={comment.id}
          comment={comment}
          onDelete={onDelete}
          onEdit={onEdit}
          onReply={onReply}
        />
      ))}
    </div>
  );
};

export default CommentList;
